import React from "react";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const OwnerList = ({ owners }) => {
  return (
    <Row>
      <Col md={{ span: 8, offset: 2 }}>
        <p>Nome</p>
      </Col>
      <Col md={{ span: 8, offset: 2 }}>
        <p>CPF</p>
      </Col>
    </Row>
  );
};

export default OwnerList;
